import '../App.css';

import FormSet from "../Components/FormSet"

function Login(){
    return(
        <div className='TopNavMargin BigHeadingBox DarkGreenBox'>
        <div className=' TotallyCenter'>
            <h1 className="CursiveFont LgFont TopNavMargin LightGreenFontShade">
                LOGIN
            </h1> 
            <div>
            <FormSet
                Title=""
                FirstInput="NAME"
                SecondInput="EMAIL ID"
                ThirdInput="PHONE NO"
                PhoneNumberInput="true"
            />
            </div>
        </div>
        </div>
    );
}

export default Login;
